import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import Form from "./components/form";
import List from "./components/List";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/books/:id/edit" components={Form} />
          <Route path="/books/new" components={Form} />
          <Route path="/books/" components={List} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
